webpackJsonp([53],{830:function(n,e){n.exports='TimePicker \u65f6\u95f4\u9009\u62e9\u5668\n===\n\n\u7528\u4e8e\u9009\u62e9\u6216\u8f93\u5165\u65e5\u671f\n\n### \u57fa\u672c\u7528\u6cd5\n\u70b9\u51fb `TimePicker`\uff0c\u7136\u540e\u53ef\u4ee5\u5728\u6d6e\u5c42\u4e2d\u9009\u62e9\u6216\u8005\u8f93\u5165\u67d0\u4e00\u65f6\u95f4\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      value: new Date(2017, 6, 28, 15, 51),\n    }\n  }\n  handleChang(value,date) {\n    console.log(\'TimePicker:Chang:\', value,date)\n  }\n  render() {\n    return (\n      <div>\n        <TimePicker\n          onChange={this.handleChang.bind(this)}\n          disabledHours={[\'00\',\'01\']}\n          disabledMinutes={[\'01\',\'02\']}\n          disabled={false}\n          format="H:i:s"\n          placeholder="\u9009\u62e9\u65f6\u95f4de\u62c9\uff01\u66f4\u6539"\n          value={this.state.value}\n        />\n      </div>\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n### \u56fa\u5b9a\u65f6\u95f4\u70b9\n\n\x3c!--DemoStart--\x3e \n\u4f7f\u7528 `<TimeSelect>` \uff0c\u5206\u522b\u901a\u8fc7`star`\u3001`end`\u548c`step`\u6307\u5b9a\u53ef\u9009\u7684\u8d77\u59cb\u65f6\u95f4\u3001\u7ed3\u675f\u65f6\u95f4\u548c\u6b65\u957f\uff0c\u901a\u8fc7`minTime`\u548c`maxTime`\u6765\u9650\u5236\u65f6\u95f4\u3002\n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      value: new Date(2017, 6, 28, 15, 51),\n    }\n  }\n  handleChang(value,date) {\n    console.log(\'time-select Chang: \', value,date)\n  }\n  render() {\n    return (\n      <div>\n        <TimeSelect\n          start="08:30"\n          step="00:15"\n          end="18:30"\n          minTime="9:30"\n          // hideDisabled={true}\n          onChange={this.handleChang.bind(this)}\n          value={this.state.value}\n          //placeholder="\u9009\u62e9\u65f6\u95f4"\n        />\n        <TimeSelect\n          start="08:30"\n          step="00:15"\n          end="18:30"\n          minTime="9:30"\n          hideDisabled={true}\n          onChange={this.handleChang.bind(this)}\n          value={null}\n          //placeholder="\u9009\u62e9\u65f6\u95f4"\n        />\n      </div>\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n### \u56fa\u5b9a\u65f6\u95f4\u70b9\u7981\u7528\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = { value: new Date(2017, 6, 28, 15, 51), }\n  }\n  handleChang(value,date) {\n    console.log(\'time-select Chang: \', value,date)\n  }\n  render() {\n    return (\n      <TimeSelect\n        start="08:30"\n        step="00:15"\n        end="18:30"\n        disabled={true}\n        minTime="9:30"\n        onChange={this.handleChang.bind(this)}\n        value={this.state.value}\n        placeholder="\u9009\u62e9\u65f6\u95f4"\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n### \u56fa\u5b9a\u65f6\u95f4\u8303\u56f4\n\n\u53ef\u4ee5\u901a\u8fc7`hideDisabled={true}`\u6765\u8bbe\u7f6e\u7981\u7528\u7684\u4e0d\u663e\u793a\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props)\n    this.state = {\n      startDate: new Date(2017, 9, 10, 14, 30),\n      endDate: new Date(2017, 9, 10, 15, 30)\n    }\n  }\n\n  handleStartUpdate(value,startDate) {\n    console.debug(\'time-select startDate update: \', startDate)\n    this.setState({startDate})\n  }\n\n  handleEndUpdate(value,endDate){\n    console.debug(\'time-select endDate update: \', endDate)\n    this.setState({endDate})\n  }\n\n  render() {\n    return (\n      <div>\n        <TimeSelect\n          start="08:30"\n          step="00:15"\n          end="18:30"\n          onChange={this.handleStartUpdate.bind(this)}\n          value={this.state.startDate}\n          placeholder="\u9009\u62e9\u65f6\u95f4"\n        />\n        <TimeSelect\n          start="08:30"\n          step="00:15"\n          end="18:30"\n          onChange={this.handleEndUpdate.bind(this)}\n          value={this.state.endDate}\n          minTime={this.state.startDate}\n          placeholder="\u9009\u62e9\u65f6\u95f4"\n        />\n      </div>\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n\n### \u4efb\u610f\u65f6\u95f4\u70b9\n\n\u4f7f\u7528 `<TimePicker>`\uff0c\u53ef\u4ee5\u9009\u62e9\u4efb\u610f\u65f6\u95f4\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      value: new Date(2017, 6, 28, 15, 51),\n      showTime:\'\',\n    }\n  }\n  handleChang(value,date) {\n    console.log(\'value;\',value)\n    this.setState({\n      showTime:value,\n      value:date\n    })\n  }\n  render() {\n    const {showTime} = this.state;\n    return (\n      <div>\n        <TimePicker\n          //style={{width:100}}\n          onChange={this.handleChang.bind(this)}\n          disabledHours={[\'00\',\'01\']}\n          disabledMinutes={[\'01\',\'02\']}\n          disabled={true}\n          //hideDisabled={true}\n          format="H:i:s"\n          placeholder="\u9009\u62e9\u65f6\u95f4de\u62c9\uff01"\n          value={new Date(2017, 6, 28, 15, 51)}\n        />\n        <TimePicker\n          //style={{width:100}}\n          size="large" \n          onChange={this.handleChang.bind(this)}\n          disabledHours={[\'00\',\'01\']}\n          disabledMinutes={[\'01\',\'02\']}\n          disabled={false}\n          // hideDisabled={true}\n          format="H:i"\n          placeholder="\u9009\u62e9\u65f6\u95f4de\u62c9\uff01\u66f4\u6539"\n          value={this.state.value}\n        />\n        <TimePicker\n          //style={{width:100}}\n          size="mini" \n          onChange={this.handleChang.bind(this)}\n          disabledHours={[\'00\',\'01\']}\n          disabledMinutes={[\'01\',\'02\']}\n          disabled={false}\n          format="H:i:s"\n          placeholder="\u9009\u62e9\u65f6\u95f4de\u62c9\uff01\u66f4\u6539"\n          value={this.state.value}\n        />\n        <div style={{padding:"20px 0 0 0"}}>\n          \u9009\u62e9\u65f6\u95f4\uff1a{showTime}\n        </div>\n      </div>\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n\n## \u5b89\u88c5\u548c\u4f7f\u7528\n\n```bash\nnpm install uiw --save\n```\n\n```js\nimport { TimePicker, TimeSelect } from \'uiw\';\n// or\nimport TimePicker from \'uiw/lib/time-picker\';\nimport TimeSelect from \'uiw/lib/time-select\';\n```\n\n> \u8f93\u5165\u6846\u7ee7\u627f `<Input/>` \u7ec4\u4ef6\u3002\u652f\u6301 Input \u7684\u90e8\u5206\u5c5e\u6027\u5982`size`,`disabled`, `size`, `autoFocus`, `preIcon`, `defaultValue`\n\n### \u516c\u5171\u53c2\u6570 \n\n| \u53c2\u6570      | \u8bf4\u660e    | \u7c7b\u578b      |  \u9ed8\u8ba4\u503c   |\n|--------- |-------- |---------- |-------- |\n| className | \u9009\u62e9\u5668\u7c7b\u540d | String | - |\n| value | \u503c | Date/Null | - |\n| disable | \u7981\u7528\u65f6\u95f4\u9009\u62e9\u5668 | Boolean | `false` |\n| placeholder | \u503c | String | - |\n| placeholder | \u5360\u4f4d\u5185\u5bb9\u63d0\u793a | String | `false` |\n| hideDisabled | \u4e0d\u53ef\u9009\u62e9\u7684\u9879\u9690\u85cf | Boolean | `false` |\n\n### TimeSelect \n\n| \u53c2\u6570      | \u8bf4\u660e    | \u7c7b\u578b      |  \u9ed8\u8ba4\u503c   |\n|--------- |-------- |---------- |-------- |\n| start | \u5f00\u59cb\u65f6\u95f4 | String | 09:00 |\n| end | \u7ed3\u675f\u65f6\u95f4 | String | 18:00 |\n| step | \u95f4\u9694\u65f6\u95f4 | String | 00:30 |\n| minTime | \u6700\u5c0f\u65f6\u95f4 | Date | - |\n| maxTime | \u6700\u5927\u65f6\u95f4 | Date | - |\n| onChange | \u65f6\u95f4\u53d1\u751f\u53d8\u5316\u7684\u56de\u8c03 time:`9:30`\u3001timeString:`Fri Jul 28 2017 09:45:00 GMT+0800 (CST)` | function(time:String, timeString: String) | - |\n\n### TimePicker \n\n| \u53c2\u6570      | \u8bf4\u660e    | \u7c7b\u578b      |  \u9ed8\u8ba4\u503c   |\n|--------- |-------- |---------- |-------- |\n| format | \u9ed8\u8ba4\u663e\u793a\u65f6\u5206\u79d2\uff0c\u53ef\u4ee5\u5b9a\u4e49`H:i`\u53ea\u663e\u793a\u5341\u5206 | String | `H:i:s` |\n| disabledHours | \u7981\u6b62\u9009\u62e9\u90e8\u5206`\u5c0f\u65f6`\u9009\u9879 | Array | [] |\n| disabledMinutes | \u7981\u6b62\u9009\u62e9\u90e8\u5206`\u5206\u949f`\u9009\u9879 | Array | [] |\n| disabledSeconds | \u7981\u6b62\u9009\u62e9\u90e8\u5206`\u79d2`\u9009\u9879 | String | [] |\n| onChange | \u65f6\u95f4\u53d1\u751f\u53d8\u5316\u7684\u56de\u8c03 time:`9:30`\u3001timeString:`Fri Jul 28 2017 09:45:00 GMT+0800 (CST)` | function(time:String, timeString: String) | - |\n'}});